    var firebaseCurrentUser = firebase.auth().currentUser;

    if (to.path === "/pages/login" || to.path === "/pages/forgot-password" || to.path === "/pages/error-404" || to.path === "/pages/error-500" || to.path === "/pages/register" || to.path === "/callback" || to.path === "/pages/comingsoon" || auth.isAuthenticated() || firebaseCurrentUser) {
      return next();
    }

    router.push({
      path: '/pages/login',
      query: {
        to: to.path
      }
    }); // Specify the current path as the customState parameter, meaning it
    // will be returned to the application after auth
    // auth.login({ target: to.path });
  });
});
export default router;

